import React from 'react';
import './Certificate.css'
const Certificate = () => {
  return (
    <div className='certificate' id='certificate'>
        <h1>Certificates</h1>
     <div className='certficate__img'>
      <img src='https://images.unsplash.com/photo-1559588501-59a118c47e59?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D' alt='' />
      <img src='https://images.unsplash.com/photo-1559588501-59a118c47e59?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D' alt='' />
      <img src='https://images.unsplash.com/photo-1559588501-59a118c47e59?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D' alt='' />
      <img src='https://images.unsplash.com/photo-1559588501-59a118c47e59?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D' alt='' />
    </div></div>
  );
};

export default Certificate;
